Creating a full-stack web application using React, Node.js, and Express.js involves several steps. Below is a step-by-step guide to help you create a simple application that allows you to add and display dummy data. Additionally, I'll provide instructions on how to deploy the application.

### Step 1: Set Up the Project

1. **Initialize the Project**

   Create a new directory for your project and navigate into it:
   ```sh
   mkdir my-fullstack-app
   cd my-fullstack-app
   ```

2. **Initialize Node.js Project**

   Initialize a new Node.js project:
   ```sh
   npm init -y
   ```

3. **Install Dependencies**

   Install the necessary dependencies:
   ```sh
   npm install express body-parser cors
   ```

### Step 2: Set Up the Backend (Node.js and Express.js)

1. **Create the Server File**

   Create a file named `server.js` in the root directory:
   ```js
   // server.js
   const express = require('express');
   const bodyParser = require('body-parser');
   const cors = require('cors');

   const app = express();
   const PORT = process.env.PORT || 5000;

   app.use(cors());
   app.use(bodyParser.json());

   let dummyData = [];

   app.get('/api/data', (req, res) => {
     res.json(dummyData);
   });

   app.post('/api/data', (req, res) => {
     const newData = req.body;
     dummyData.push(newData);
     res.json(dummyData);
   });

   app.listen(PORT, () => {
     console.log(`Server is running on port ${PORT}`);
   });
   ```

### Step 3: Set Up the Frontend (React)

1. **Create a React App**

   Use Create React App to set up the frontend:
   ```sh
   npx create-react-app client
   cd client
   ```

2. **Install Axios**

   Install Axios for making HTTP requests:
   ```sh
   npm install axios
   ```

3. **Create Components**

   Create a simple form to add data and a list to display the data.

   - **App.js**
     ```jsx
     // client/src/App.js
     import React, { useState, useEffect } from 'react';
     import axios from 'axios';

     function App() {
       const [data, setData] = useState([]);
       const [newData, setNewData] = useState('');

       useEffect(() => {
         fetchData();
       }, []);

       const fetchData = async () => {
         const result = await axios.get('http://localhost:5000/api/data');
         setData(result.data);
       };

       const addData = async () => {
         const result = await axios.post('http://localhost:5000/api/data', { text: newData });
         setData(result.data);
         setNewData('');
       };

       return (
         <div className="App">
           <h1>Dummy Data App</h1>
           <input
             type="text"
             value={newData}
             onChange={(e) => setNewData(e.target.value)}
           />
           <button onClick={addData}>Add Data</button>
           <ul>
             {data.map((item, index) => (
               <li key={index}>{item.text}</li>
             ))}
           </ul>
         </div>
       );
     }

     export default App;
     ```

