To create a Chrome extension that takes screenshots of a webpage, you'll need to follow these steps:

1. **Create the necessary files:**
   - `manifest.json`
   - `background.js`
   - `popup.html`
   - `popup.js`
   - `content.js`

2. **Set up the manifest file:**

Create a `manifest.json` file with the following content:

```json
{
  "manifest_version": 3,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "description": "Take screenshots of a webpage",
  "permissions": ["activeTab", "scripting"],
  "background": {
    "service_worker": "background.js"
  },
  "action": {
    "default_popup": "popup.html",
    "default_icon": {
      "16": "icon16.png",
      "48": "icon48.png",
      "128": "icon128.png"
    }
  },
  "icons": {
    "16": "icon16.png",
    "48": "icon48.png",
    "128": "icon128.png"
  }
}
```

3. **Create the background script:**

Create a `background.js` file. This file will handle the message passing between the popup and the content script.

```javascript
chrome.runtime.onInstalled.addListener(() => {
  console.log("Extension installed");
});

chrome.action.onClicked.addListener((tab) => {
  chrome.scripting.executeScript({
    target: { tabId: tab.id },
    files: ['content.js']
  });
});
```

4. **Create the popup HTML:**

Create a `popup.html` file with a button to trigger the screenshot.

```html
<!DOCTYPE html>
<html>
<head>
  <title>Webpage Screenshot</title>
  <style>
    body {
      width: 200px;
      height: 100px;
      display: flex;
      justify-content: center;
      align-items: center;
    }
    button {
      padding: 10px 20px;
      font-size: 16px;
    }
  </style>
</head>
<body>
  <button id="screenshotButton">Take Screenshot</button>
  <script src="popup.js"></script>
</body>
</html>
```

5. **Create the popup script:**

Create a `popup.js` file to handle the button click event.

