3. **External APIs**: You can use external currency conversion APIs like Open Exchange Rates, XE, or CurrencyLayer to fetch real-time exchange rates and perform conversions. You can then integrate these APIs with your Shopify store using Shopify's API to display converted prices.

4. **Custom Scripts**: If you have some programming knowledge, you can write custom scripts using Shopify's Script Editor (available on Shopify Plus) to handle currency conversion. This approach provides more flexibility but requires coding skills.

